function Start({start}) {

  const startRound = Math.ceil(start);
  console.log(startRound);

return (
    <div className="rating">
   {1 == startRound ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}
   {2 == startRound ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}
   {3 == startRound ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}
   {4 == startRound ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}
   {5 == startRound ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}

    </div>
  )
}
export default Start
